import React from "react";
import techtorchlogo from "../images/techtorchlogo.jpg";
import "./ContactUS.css"; // Import CSS file for styling

const ContactUs = () => {
  return (
    <div className="contact-container"> {/* Apply contact-container class here */}
      <div className="contactus-firstchild">
        <div className="contactUStext-outer">
          <h3>CONTACT US</h3>
          <div>+91-7038782722</div>
          <div>contact@techtorchsolutions.com</div>
          <div>Pune, Maharashtra</div>
        </div>
        <div>
          <h3>SERVICES</h3>
          <div>App Development</div>
          <div>Website Development</div>
          <div>UI/UX Design</div>
          <div>Digital Marketing and Lead Generation</div>
          <div>Training Programs</div>
        </div>
        <div>
          <img src={techtorchlogo} className="contact-us-techtorchlogo" alt="Techtorch Solutions" />
        </div>
      </div>
      <div className="contactus-secondchild">Copyright Â© 2024 | Powered by Techtorch solutions</div>
    </div>
  );
};

export default ContactUs;
